import React from 'react'
import sos from '../../res/song1.png';
import moon from '../../res/moon.png'
import './albumsp.css';

import {GraphQLClient, gql} from 'graphql-request';

const graphcms = new GraphQLClient(
  "https://api-ca-central-1.hygraph.com/v2/cli6uzg0l3f4a01uo260222h0/master"
);

const QUERY = gql`
  {
    posts{
      id,
      title,
      dataPublished,
      slug,
      label,
      year,
      rating,
      type,
      content {
        html
      }
      artist {
        name
        photo {
          url
        }
      }
      coverPhoto {
        publichedAt {
          createdBy {
            id
          }
        }
        url
      }
    }
  }
`

const Albumsp = () => {
  return (
    <div className='album-container'>
      <img src={moon} className='moon1'/>
      <h1 className='albums-header'>ALBUM REVIEWS</h1>
      <main>
        <div className='highlight-album shifter'>
          <img src={sos}/>
          <h2>AMERICA HAS A PROBLEM</h2>
          <p>SZA</p>
          <p>MAY 24, 2023</p>
        </div>

        <aside>
          <div className='side-album'>
            <img src={sos}/>
            <div className='side-text'>
              <h2>SOS</h2>
              <p>SZA</p>
              <p>MAY 24, 2023</p>
              </div>
          </div>

          <div className='side-album'>
            <img src={sos}/>
            <div className='side-text'>
              <h2>SOS</h2>
              <p>SZA</p>
              <p>MAY 24, 2023</p>
              </div>
          </div>

          <div className='side-album'>
            <img src={sos}/>
            <div className='side-text'>
              <h2>SOS</h2>
              <p>SZA</p>
              <p>MAY 24, 2023</p>
              </div>
          </div>

        </aside>
      </main>

    </div>
  )
}

export default Albumsp
